import React from 'react';
import SmallDiv from './Smalldiv';

function MultiDiv() {
    return (
        <React.Fragment>
        <h1 className="news">BBC-NEWS</h1>
        <SmallDiv/>
        </React.Fragment>
    )
}

export default MultiDiv;
